Based on the error message, the `SecurityConfig` class has a constructor that requires a bean of type `ReactiveClientRegistrationRepository`, but it is not being provided. To fix this issue, you need to define a bean of type `ReactiveClientRegistrationRepository` in your configuration.

Here's how you can define the bean in your `SecurityConfig` class:

```java
@Configuration
@EnableWebFluxSecurity
public class SecurityConfig {

    private final ReactiveClientRegistrationRepository reactiveClientRegistrationRepository;

    public SecurityConfig(ReactiveClientRegistrationRepository reactiveClientRegistrationRepository) {
        this.reactiveClientRegistrationRepository = reactiveClientRegistrationRepository;
    }

    // ... existing code ...

    @Bean
    public ReactiveClientRegistrationRepository reactiveClientRegistrationRepository() {
        // Define and configure your ReactiveClientRegistrationRepository bean here
        return new YourReactiveClientRegistrationRepository();
    }
}
```

Replace `YourReactiveClientRegistrationRepository` with the actual implementation of `ReactiveClientRegistrationRepository` that you want to use.

By defining the `reactiveClientRegistrationRepository` bean, it will be available for autowiring in the `SecurityConfig` constructor, resolving the `NoSuchBeanDefinitionException` error.
